(1, 'About Us', 'about-us', '<div style=\"text-align: justify;\"><span style=\"color: rgb(46, 45, 45); font-family: Roboto, sans-serif; font-size: 18px;\">Founded in 2017 by Yogesh Jangid, RiGoRiDe is one of the largest ride-sharing companies. Rigoride integrates city transportation for customers and driver-partners onto a mobile technology platform ensuring convenient, transparent, and quick service fulfilment. Rigoride is focused on leveraging the best of technology and building innovative solutions ground-up, that are relevant at global scale. Notably, in 2017, Rigoride the worldâ€™s first connected car platform for ride-sharing was launched, transforming commuting experiences and setting the tone for global innovation in this space. Beyond offering a highly personal experience for users during their rides, to build a high quality interactive and productive experience for its users. Using the Rigoride mobile app, users across 15+ cities, can connect with over 20000 driver-partners across cabs, auto- E-rickshaws, and taxis, Bike. Driven by a hyperlocal approach, Rigoride is committed to its mission of building mobility for a people.</span></div>', 'AC', '2018-09-10 18:34:48', '2018-09-25 12:27:16'),
