(3, 'Terms & Conditions', 'terms-and-conditions', '<p style=\"text-align: justify; \">\n                            Bhatiyani Enterprise Private Limited, a company incorporated under the Companies Act, 2013, with its corporate office at No5-6, Lower Ground OK Plus Mall Near Bus Stand ,Madanganj-Kishangarh Ajmer Raj.India (hereinafter referred to as the â€œCompanyâ€) has created an intermediary online platform by the name RigoRide, www.Rigoride.com (hereinafter referred to as the â€œSiteâ€, â€œWebsiteâ€, â€œPlatformâ€ or â€œRigorideâ€) which acts as an intermediary auto rickshaw rides. The marketplace is a platform for domestic consumers to transact with third party sellers, who have been granted access to the Site. The Company does not provide any services to users other than providing the marketplace as a platform to transact at their own cost and risk, and other services as may be specifically be notified in writing. The Company is not and cannot be a party to any transaction between you and the third party sellers or auto rickshaw driver, or have any control, involvement or influence over the products purchased by you or services received by you from such third party sellers / auto drivers. (Hereinafter together referred to a â€œProducts and Servicesâ€). The said Products and Services are described in detail in clause 4 hereunder.\n\n                        </p>\n                        <p style=\"text-align: justify;\">\n                            By accessing and/or using the Site the user 1 acknowledges that he/she has read understood and agrees to be legally bound by the terms and conditions set forth in this document. If you do not agree to abide by thus User Agreement (the â€œAgreementâ€), you are not permitted to access or use the Site. All text, graphics, design, content, and other works are copyrighted works of Company. The Company acknowledges proprietary rights of third parties displayed on the Site.\n                        </p>\n                    