e shall have the right at any time to change or discontinue any aspect or feature of Website, including, but not limited to, content, material, and third-party communication link 2 (herein after referred to as â€œThird Party Websitesâ€) needed for access or use.\n\n                            </li>\n                        </ul>\n                        <h6 style=\"text-align: justify;\">SERVICES AND CONTRACT\n                        </h6>\n                        <ul>\n                            <li style=\"text-align: justify;\">On the Website, you have the ability to compare third party products and services, including discounts being offered by such third parties on the sale of its products and services.\n                             </li>\n                            <li style=\"text-align: justify;\">We allow or provide access to websites hosted by other third parties, including the possibility to compare various services offered by third parties.\n                            </li>\n                        </ul>\n\n                        <h6 style=\"text-align: justify;\">CHANGED TERMS\n                        </h6>\n                        <p style=\"text-align: justify;\">The Company shall have the right at any time to change or modify the terms and conditions applicable to userâ€™s use of Website, or any part thereof, or to impose new conditions, including, but not limited to, adding fees and charges for use. Such changes, modifications, additions or deletions shall be effective immediately upon notice thereof, which may be given by means including, but not limited to, posting on Website, or by electronic or conventional mail, or by any other means by which user obtains notice thereof. Any use of Website by user after such notice shall be deemed to constitute acceptance by user of such changes, modifications or additions.\n                        </p>\n\n                        <h6 style=\"text-align: justify;\">DESCRIPTION OF SERVICES\n                  