llers or the prices of such products charged by such third-party sellers. The Company therefore disclaims all warranties and liabilities associated with any products offered on the Site. Services on the Site are available to only select geographies in India, and are subject to restrictions based on business hours and days of third party sellers. Transactions through the Site may be subject to a delivery charge where the minimum order size is not met. You will be informed of such delivery charge at the stage of check-out for a transaction through the Marketplace.\n                                </li>\n                            </ul>\n\n                        <h6 style=\"text-align: justify;\">EQUIPMENT</h6>\n                        <p style=\"text-align: justify;\">\n                            User shall be responsible for obtaining and maintaining all telephone, computer hardware, software and other equipment needed for access to and use of Website and all charges related thereto.\n                        </p>\n\n                        <h5 style=\"text-align: justify;\">USER CONDUCT</h5>\n                        <ul>\n                            <li style=\"text-align: justify;\">User shall use the Website for lawful purposes only. User shall not post or transmit through the Website any material which violates or infringes in any way upon the rights of others, which is unlawful, threatening, abusive, defamatory, invasive of privacy or publicity rights, vulgar, obscene, profane or otherwise objectionable, which encourages conduct that would constitute a criminal offense, give rise to civil liability or otherwise violate any law, or which, without our express prior approval, contains advertising or any solicitation with respect to Products and Services. Any conduct by user that in our discretion restricts or inhibits any other user from using or enjoying the Website will not be permitted.</li>\n                            <li style=\"text-align: justify;\">The Website contains copyrighted material, trademarks and other proprietary information, including, but not limited to, text, photos, graphics which may belong to third parties and is copyrighted as a collective work under respective copyright laws. Jugnoo acknowledges the proprietary rights of other parties mentioned on our Website.</li>\n                            <li style=\"text-align: justify;\">User may not modify, publish, copy, reproduce, transmit, participate in the transfer or sale, create derivative works, or in any way exploit, any of the content, in whole or in part, except as otherwise expressly permitted under copyright law, no copying, redistribution, retransmission,publication or commercial exploitation of Websiteâ€™s material will be permitted without express permission of the Company and / or the copyright owner.</li>\n                            <li style=\"text-align: justify;\">User acknowledges that it does not acquire any ownership rights by downloading copyrighted material. The User shall not upload, post or otherwise make available on the Website any material protected by copyright, trademark or any other proprietary right without express permission of the owner of the copyright, trademark or other proprietary right and the burden of determining that any material is not protected by copyright rests with user. User shall be solely liable for any damage resulting from any infringement of copyrights, proprietary rights, or any other harm resulting from such a submission. By submitting material to any public area or the Website, user automatically grants or warrants that the owner of such material has expressly granted Jugnoo royalty-free, perpetual, irrevocable, non-exclusive right and license to use, reproduce, modify, adapt, publish, translate and distribute such material (in whole or in part) world-wide and/or to incorporate it in other works in any form, media or technology now known or hereafter developed for the full term of any copyright that may exist in such material. User also permits any other user to access, view, and store or reproduce the material for that userâ€™s personal use. User hereby grants the Company the right to edit, copy, publish and distribute any material made available on the Website by user.</li>\n                        </ul>\n\n                        <h6 style=\"text-align: justify;\">MEMBER ACCOUNT, PASSWORD, AND SECURITY</h6>\n                        <p style=\"text-align: justify;\">\n                            If any of our services require user to open an account, user must complete the registration process by providing us with current, complete and accurate information as prompted by the applicable registration form. User also will choose a password and a user name. User is entirely responsible for maintaining the confidentiality of userâ€™s password and account. Furthermore, user is entirely responsible for any and all activities that occur under userâ€™s account. User agrees to notify the Company immediately of any unauthorized use of userâ€™s account or any other breach of security. The Company will not be liable for any loss that user may incur as a result of someone else using userâ€™s password or account, either with or without userâ€™s knowledge. However, user could be held liable for losses incurred by the Company or another party due to someone else using userâ€™s account or password. User may not use anyone elseâ€™s account at any time, without the permission of the account holder.\n                        </p>\n\n                        <h6 style=\"text-align: justify;\">LIMITATION OF LIABILITY</h6>\n                        <ul>\n                            <li style=\"text-align: justify;\">User expressly agrees that use of the Website is at userâ€™s sole risk. Neither the Company, its affiliates nor any of their respective employees, agents, third party content providers or licensors warrant that the Website will be uninterrupted or error free; nor do they