stify;\">LINKS TO THIRD PARTY WEBSITES\n                        </h6>\n                        <ul>\n                            <li style=\"text-align: justify;\">The links on the Website (including Company appointed vendorâ€™s websites) will let you leave our Website. The linked sites are not under the control of Rigoride and Rigoride is not responsible for the contents of any linked site or any link contained in a linked site, or any changes or updates to such sites. Rigoride is not responsible for webcasting or any other form of transmission received from any linked site. Rigoride is providing these links to you only as a convenience, and the inclusion of any link does not imply endorsement by Rigoride of the site.\n                            </li>\n                            <li style=\"text-align: justify;\">Rigoride is only an intermediary service provider 3 (herein after referred to as â€œIntermediaryâ€), and not a distributor or publisher of content supplied by third parties. Accordingly, Jugnoo has no more editorial control over such content than does a public library, bookstore, or newsstand. Any opinions, advice, statements, services, offers, or other information or content expressed or made available by third parties, including, users or any other user of website, are those of the respective author(s) or distributor(s), vendors and not of Rigoride. Rigoride does not guarantee the accuracy, completeness, or usefulness of neither content nor its merchantability or fitness.\n                            </li>\n                            <li style=\"text-align: justify;\">In many instances, the content available through the Website represents the opinions and judgments of the respective information provider, not under contract with Rigoride. Rigoride neither endorses nor is responsible for the accuracy or reliability of any opinion, advice or statement made on the Website by anyone other than our authorized employee or spokespersons while acting in their 