=\"text-align: justify;\">User agrees to defend, indemnify and hold harmless the Company, its affiliates and their respective directors, officers, employees and agents from and against all claims and expenses, including attorneyâ€™s fees, arising out of the use of Website by user.\n                        </p>\n                        <h6 style=\"text-align: justify;\">PAYMENT SECURITY\n                        </h6>\n                        <p style=\"text-align: justify;\">Rigoride is only an Intermediary and therefore does not ensure that transactions you conduct online is in a safe and secure. To achieve this, please read the terms of use, privacy policy and any other policies or agreements outlined on each respective third party website whose service the user may decide to avail at a given point in time.</p>\n\n                        <h6 style=\"text-align: justify;\">TERMINATION\n                        </h6>\n                        <p style=\"text-align: justify;\">Either Rigoride or user may terminate this Agreement at any time. Without limiting the foregoing, Rigoride shall have the right to immediately terminate userâ€™s account in the event of any conduct by user which Rigoride in its sole discretion, considers to be unacceptable, or in the event of any breach by user of this Agreement.\n                        </p>\n\n                        <h6 style=\"text-align: justify;\">MISCELLANEOUS\n                        </h6>\n                        <p style=\"text-align: justify;\">This Agreement and any operating rules for Website established by Rigoride constitute the entire agreement of the parties with respect to the subject matter hereof, and supersede all previous written or oral agreements between the parties with respect to such subject matter.\n                        </p>\n\n                        <h6 style=\"text-align: justify;\">TRADEMARKS\n                        </h6>\n                        <p style=\"text-align: justify;\">The names of ac