ll remain in force. This contains the entire Agreement between the user and the Company concerning your use of the Site. If you have questions regarding the Agreement, please email:&nbsp;legal@Rigoride.com.</p>\n\n                        <h6 style=\"text-align: justify;\">GOVERNING LAW AND JURISDICTION</h6>\n                        <p style=\"text-align: justify; \">This Agreement shall be governed by and construed in accordance with the laws of India and courts in Kishangarh(Ajmer), India only shall have jurisdiction over any dispute arising out of or relating to this Agreement, and each party hereby consents to the jurisdiction and venue of such courts.</p>', 'AC', '2018-09-10 18:34:48', '2018-11-02 23:49:54');
