(4, 'User Agreement', 'user-agreement', '<p style=\"text-align: justify; \">\n                            Please read these terms carefully. Bhatiyani Enterprise Private Limited (hereinafter referred to as the â€œCompanyâ€) has created an intermediary online platform by the name Rigoride Drivers, (hereinafter referred to as the â€œAppâ€, â€œPlatformâ€ or â€œRigorideâ€) which acts as an intermediary e-commerce marketplace facilitating drivers to connect with potential customers. The marketplace is a platform for taxi drivers to transact with third party customers, who have been granted access to the App. The Company does not provide any services to users other than providing the marketplace as a platform to transact at their own cost and risk, and other services as may be specifically be notified in writing. The Company is not and cannot be a party to any transaction between you and the third-party sellers or taxi driver, or have any control, involvement or influence over the products purchased by you or services received by you from such third-party sellers / taxi drivers. (Hereinafter together referred to a â€œServicesâ€). The said Products and Services are described in detail in clause 4 hereunder.\n\n                        </p>\n                        <p style=\"text-align: justify;\">\n                            By accessing and/or using the Rigoride Drivers application (â€œAPPâ€) the taxi driver acknowledges that he/she has read understood and agrees to be legally bound by the terms and conditions set forth in this document. If you do not agree to abide by thus User Agreement (the â€œAgreementâ€), you are not permitted to access or use the App. All text, graphics, design, content, and other works are copyrighted works of Company. The Company acknowledges proprietary rights of third parties displayed on the App.\n                        </p>\n                        <p style=\"text-align: justify;\">\n                            For purpose of this Agreement 