 or use.\n\n                            </li>\n                        </ul>\n                        <h6 style=\"text-align: justify;\">SERVICES AND CONTRACT\n                        </h6>\n                        <ul>\n                            <li style=\"text-align: justify;\">On the App, you have the ability to compare third party products and services, including discounts being offered by such third parties on the sale of its products and services.\n                             </li>\n                            <li style=\"text-align: justify;\">We allow or provide access to Apps hosted by other third parties, including the possibility to compare various services offered by third parties.\n                            </li>\n                        </ul>\n\n                        <h6 style=\"text-align: justify;\">Changed Terms\n                        </h6>\n                        <p style=\"text-align: justify;\">The Company shall have the right at any time to change or modify the terms and conditions applicable to userâ€™s use of App, or any part thereof, or to impose new conditions, including, but not limited to, adding fees and charges for use. Such changes, modifications, additions or deletions shall be effective immediately upon notice thereof, which may be given by means including, but not limited to, posting on App, or by electronic or conventional mail, or by any other means by which user obtains notice thereof. Any use of App by user after such notice shall be deemed to constitute acceptance by user of such changes, modifications or additions.\n                        </p>\n\n                        <h6 style=\"text-align: justify;\">description of services\n                        </h6>\n                        <p style=\"text-align: justify;\">through the app, we provide users with access to a variety of services, as described in detail hereunder:</p>\n                            <ul>\n                                <li style=\"text-align: justify;\">\n                                    the services constitute a technology platform that enables users of Rigorideâ€™s mobile application or app provided as part of the services to arrange and schedule transportation and/or logistics services with independent third-party providers of such services, including independent third-party transportation providers and independent third-party logistics providers under agreement with Rigoride or certain of Rigorideâ€™s affiliates (â€œthird party providersâ€). unless otherwise agreed by Rigoride in a separate written agreement with you, the services are made available solely for your personal, non-commercial use. you acknowledge that Rigoride does not provide transportation or logistics services or function as a transportation carrier and that all such transportation or logistics services are provided by independent third-party contractors who are not employed by Rigoride or any of its affiliates.\n                                </li>\n                                <li style=\"text-align: justify;\">\n                                    the company is a technology company that does not provide or engage in transportation services and the company is not a transportation provider. the software and the application are intended to be used for facilitating you (as a transportation provider) to offer your transportation services to your passenger or customer. the company is not responsible or liable for the acts and/or omissions of any services you provided to your passengers, and for any illegal action committed by you. you shall, at all time, not claim or cause any person to misunderstand that you are the agent, employee or staff of the company, and the services provided by you is not, in anyway, be deemed as services of the company.\n                                </li>\n                            </ul>\n\n                        <h6 style=\"text-align: justify;\">Equipment</h6>\n                        <p style=\"t