y and / or the copyright owner.</li>\n                            <li style=\"text-align: justify;\">User acknowledges that it does not acquire any ownership rights by downloading copyrighted material. The User shall not upload, post or otherwise make available on the App any material protected by copyright, trademark or any other proprietary right without express permission of the owner of the copyright, trademark or other proprietary right and the burden of determining that any material is not protected by copyright rests with user. User shall be solely liable for any damage resulting from any infringement of copyrights, proprietary rights, or any other harm resulting from such a submission. By submitting material to any public area or the App, user automatically grants or warrants that the owner of such material has expressly granted Rigoride royalty-free, perpetual, irrevocable, non-exclusive right and license to use, reproduce, modify, adapt, publish, translate and distribute such material (in whole or in part) world-wide and/or to incorporate it in other works in any form, media or technology now known or hereafter developed for the full term of any copyright that may exist in such material. User also permits any other user to access, view, and store or reproduce the material for that userâ€™s personal use. User hereby grants the Company the right to edit, copy, publish and distribute any material made available on the App by user.</li>\n                        </ul>\n\n                        <h6 style=\"text-align: justify;\">MEMBER ACCOUNT, PASSWORD, AND SECURITY</h6>\n                        <p style=\"text-align: justify;\">\n                            If any of our services require user to open an account, user must complete the registration process by providing us with current, complete and accurate information as prompted by the applicable registration form. User also will choose a password and a user name. User is entirely responsible for maintaining