efulness of neither content nor its merchantability or fitness.\n                            </li>\n                            <li style=\"text-align: justify;\">In many instances, the content available through the App represents the opinions and judgments of the respective information provider, not under contract with Rigoride. Rigoride neither endorses nor is responsible for the accuracy or reliability of any opinion, advice or statement made on the App by anyone other than our authorized employee or spokespersons while acting in their official capacities. Under no circumstances will Rigoride&nbsp;be liable for any loss or damage, whether financial or otherwise, caused by a userâ€™s reliance on information obtained through the App. It is the responsibility of user to evaluate the accuracy, completeness or usefulness of any information, opinion, advice or other content available through the App. Please seek the advice of professionals, as appropriate, regarding the evaluation of any specific information, opinion, advice or other content.</li>\n                        </ul>\n\n                        <h6 style=\"text-align: justify;\">Monitoring</h6>\n                        <p style=\"text-align: justify;\">Rigoride shall have the right, but not the obligation, to monitor the content of App, including third party Apps, to determine compliance with this Agreement and any operating rules established by Rigoride and to satisfy any law, regulation or authorized government request. Without limiting the foregoing, we shall have the right to remove any material that Rigoride in its sole discretion, finds to be in violation of the provisions hereof or otherwise objectionable.</p>\n\n                        <h6 style=\"text-align: justify;\">Indemnification</h6>\n                        <p style=\"text-align: justify;\">User agrees to defend, indemnify and hold harmless the Company, its affiliates and their respective directors, officers, employees and agents from and against all claims and expenses, including attorneyâ€™s fees, arising out of the use of App by user.\n                        </p>\n                        <h6 style=\"text-align: justify;\">PAYMENT SECURITY\n                        </h6>\n                        <p style=\"text-align: justify;\">Rigoride is only an Intermediary and therefore does not ensure that transactions you conduct online is in a safe and secure. To achieve this, please read the terms of use, privacy policy and any other policies or agreements outlined on each respective third-party App whose service the user may decide to avail at a given point in time.</p>\n\n                        <h6 style=\"text-align: justify;\">Termination\n                        </h6>\n                        <p style=\"text-align: justify;\">Either Rigoride or user may terminate this Agreement at any time. Without limiting the foregoing,Rigoride  shall have the right to immediately terminate userâ€™s account in the event of any conduct by user which Rigoride&nbsp;in its sole discretion, considers to be unacceptable, or in the event of any breach by user of this Agreement\n                        </p>\n\n                        <h6 style=\"text-align: justify;\">Miscellaneous\n                        </h6>\n                        <p style=\"text-align: justify;\">This Agreement and any operating rules for App established by Rigoride constitute the entire agreement of the parties with respect to the subject matter hereof, and supersede all previous written or oral agreements between the parties with respect to such subject matter.\n                        </p>\n\n                        <h6 style=\"text-align: justify;\">TRADEMARKS\n                        </h6>\n                        <p style=\"text-align: justify;\">The names of actual companies, Apps, services and products mentioned herein and on the App, may be the trademarks of their respective owners. Rigoride acknowledges the proprietary rights of the trademarks of other parties mentioned both in this document and on the App. Any rights not expressly granted herein are reserved.</p>\n\n                        <h6 style=\"text-align: justify;\">Your Consent</h6>\n                        <ul>\n                            <li style=\"text-align: justify;\">By using the App, you consent to the terms of our Agreement and to the Appâ€™s processing of information for the purposes given above.</li>\n                        </ul>\n\n                        <h6 style=\"text-align: justify;\">GRIEVANCE REDRESSAL MECHANISM</h6>\n                        <p style=\"text-align: justify;\">If you have any grievance relating to this Agreement, you may email our grievance officer at&nbsp;legal@Rigoride.com&nbsp;or write at the following address: Bhatiyani Enterprise Private Limited,\n                            Aadarsh Nagar, Choudhary Bhawan, Kishangarh Ajmer 305801( Raj) India\n                        </p>\n\n                        <h6 style=\"text-align: justify;\">General Provisions</h6>\n                        <p style=\"text-align: justify;\">If any provision of this Agreement is deemed void, unlawful or otherwise unenforceable for any reason, that provision shall be severed from this Agreement and the remaining provisions of this Agreement shall remain in force. This contains the entire Agreement between the user and the Company concerning your use of the App. If you have questions regarding the Agreement, please email:&nbsp;<a href=\"mailto:support@Rigoride.com\">support@Rigoride.com.</a></p>\n\n                        <h6 style=\"text-align: justify;\">Governing Law and Jurisdiction</h6>\n                        <p style=\"text-align: justify; \">This Agreement shall be governed by and construed in accordance with the laws of Kishangarh (Ajmer) and courts in Kishangarh (Ajmer)  only shall have jurisdiction over any dispute arising out of or relating to this Agreement, and each party hereby consents to the jurisdiction and venue of such courts.</p>', 'AC', '2018-09-10 18:34:48', '2018-11-08 11:27:03'),
(5, 'Privacy Policy', 'privacy-policy', '  <p>\r\n                            The terms \"We\" / \"Us\" / \"Our\"/â€Companyâ€ individually and collectively refer to Bhatiyani Enterprise Private Limited and the\r\n                            terms \"You\" /\"Your\" / \"Yourself\" refer to the users.\r\n                        </p>\r\n                        <p>This Privacy Policy is an electronic record in the form of an electronic contract formed under the\r\n                            information Technology Act, 2000 and the rules made thereunder and the amended provisions pertaining\r\n                            to electronic documents / records in various statutes as amended by the information Technology\r\n                            Act, 2000. This Privacy Policy does not require any physical, electronic or digital signature.</p>\r\n                        <p>This Privacy Policy is a legally binding document between you and Company (both terms defined below).\r\n                            The terms of this Privacy Policy will be effective upon your acceptance of the same (directly\r\n                            or indirectly in electronic form, by clicking on the I accept tab or by use of the website or\r\n                            by other means) and will govern the relationship between you and www.rigoride.com for your use\r\n                            of the website â€œWebsiteâ€ (defined below).</p>\r\n                        <p>This document is published and shall be construed in accordance with the provisions of the Information\r\n                            Technology (reasonable security practices and procedures and sensitive personal data of information)\r\n                            rules, 2011 under Information Technology Act, 2000; that require publishing of the Privacy Policy\r\n                            for collection, use, storage and transfer of sensitive personal data or information.</p>\r\n                        <p>Please read this Privacy Policy carefully by using the Website, you indicate that you understand,\r\n                            agree and consent to this Privacy Policy. If you do not agree with the terms of this Privacy\r\n                            Policy, please do not use this Website.</p>\r\n                        <p>By providing us your Information or by making use of the facilities provided by the Website, You\r\n                            hereby consent to the collection, storage, processing and transfer of any or all of Your Personal\r\n                            Information and Non-Personal Information by us as specified under this Privacy Policy. You further\r\n                            agree that such collection, use, storage and transfer of Your Information shall not cause any\r\n                            loss or wrongful gain to you or any other person.</p>\r\n                        <h6>USER INFORMATION</h6>\r\n                        <p>To avail certain services on our Websites, users are required to provide certain information for\r\n                            the registration process namely: - a) your name, b) email address, c) sex, d) age, e) PIN code,\r\n                            f) credit card or debit card details g) medical records and history h) sexual orientation, i)\r\n                            biometric information, j) password etc., and / or your occupation, interests, and the like. The\r\n                            Information as supplied by the users enables us to improve our sites and provide you the most\r\n                            user-friendly experience.</p>\r\n                        <p>All required information is service dependent and we may use the above said user information to,\r\n                            maintain, protect, and improve its services (including advertising services) and for developing\r\n                            new services</p>\r\n                        <p>Such information will not be considered as sensitive if it is freely available and accessible in\r\n                            the public domain or is furnished under the Right to Information Act, 2005 or any other law for\r\n                            the time being in force.</p>\r\n                        <h6>COOKIES</h6>\r\n                        <p>To improve the responsiveness of the sites for our users, we may use \"cookies\", or similar electronic\r\n                            tools to collect information to assign each visitor a unique, random number as a User Identification\r\n                            (User ID) to understand the user\'s individual interests using the Identified Computer. Unless\r\n                            you voluntarily identify yourself (through registration, for example), we will have no way of\r\n                            knowing who you are, even if we assign a cookie to your computer. The only personal information\r\n                            a cookie can contain is information you supply (an example of this is when you ask for our Personalised\r\n                            Horoscope). A cookie cannot read data off your hard drive. Our advertisers may also assign their\r\n                            own cookies to your browser (if you click on their ads), a process that we do not control.</p>\r\n                        <p>Our web servers automatically collect limited information about your computer\'s connection to the\r\n                            Internet, including your IP address, when you visit our site. (Your IP address is a number that\r\n                            lets computers attached to the Internet know where to send you data -- such as the web pages\r\n                            you view.) Your IP address does not identify you personally. We use this information to deliver\r\n                            our web pages to you upon request, to tailor our site to the interests of our users, to measure\r\n                            traffic within our site and let advertisers know the geographic locations from where our visitors\r\n                            come.\r\n                        </p>\r\n                        <h6>LINKS TO THE OTHER SITES</h6>\r\n                        <p>Our policy discloses the privacy practices for our own web site only. Our site provides links to\r\n                            other websites also that are beyond our control. We shall in no way be responsible in way for\r\n                            your use of such sites.5.</p>\r\n                        <h6>INFORMATION SHARING</h6>\r\n                        <p>We shares the sensitive personal information to any third party without obtaining the prior consent\r\n                            of the user in the following limited circumstances:</p>\r\n                        <p>(a)Â When it is requested or required by law or by any court or governmental agency or authority to\r\n                            disclose, for the purpose of verification of identity, or for the prevention, detection, investigation\r\n                            including cyber incidents, or for prosecution and punishment of offences. These disclosures are\r\n                            made in good faith and belief that such disclosure is reasonably necessary for enforcing these\r\n                            Terms; for complying with the applicable laws and regulations.</p>\r\n                        <p>(b)Â We proposes to share such information within its group companies and officers and employees of\r\n                            such group companies for the purpose of processing personal information on its behalf. We also\r\n                            ensure that these recipients of such information agree to process such information based on our\r\n                            instructions and in compliance with this Privacy Policy and any other appropriate confidentiality\r\n                            and security measures.</p>\r\n                        <h6>INFORMATION SECURITY</h6>\r\n                        <p>We take appropriate security measures to protect against unauthorized access to or unauthorized alteration,\r\n                            disclosure or destruction of data. These include internal reviews of our data collection, storage\r\n                            and processing practices and security measures, including appropriate encryption and physical\r\n                            security measures to guard against unauthorized access to systems where we store personal data.</p>\r\n                        <p>All information gathered on our Website is securely stored within our controlled database. The database\r\n                            is stored on servers secured behind a firewall; access to the servers is password-protected and\r\n                            is strictly limited. However, as effective as our security measures are, no security system is\r\n                            impenetrable. We cannot guarantee the security of our database, nor can we guarantee that information\r\n                            you supply will not be intercepted while being transmitted to us over the Internet. And, of course,\r\n                            any information you include in a posting to the discussion areas is available to anyone with\r\n                            Internet access.</p>\r\n                        <p>However the internet is an ever evolving medium. We may change our Privacy Policy from time to time\r\n                            to incorporate necessary future changes. Of course, our use of any information we gather will\r\n                            always be consistent with the policy under which the information was collected, regardless of\r\n                            what the new policy may be.</p>\r\n                        <h6>Grievance Redressal</h6>\r\n                        <p>Redressal Mechanism: Any complaints, abuse or concerns with regards to content and or comment or\r\n                            breach of these terms shall be immediately informed to the designated Grievance Officer as mentioned\r\n                            below via in writing or through email signed with the electronic signature toÂ â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦.. (\"Grievance\r\n                            Officer\").\r\n                        </p>\r\n                        <p>Mr Yogesh Jangid (Grievance Officer)\r\n                            <br>Bhatiyani Enterprise Private Limited\r\n                            <br>Address:- No 5-6, Lower Ground Ok Plus Mall, Near Bus Stand Ke Pass, Madanganj - Kishangarh Ajmer\r\n                            305801 Rajasthan.\r\n                            <br>\r\n                        </p>\r\n                        <p>Email:Â rigoride2017@gmail.com<br>Ph: 9925311247</p>', 'AC', '2018-09-10 18:34:48', '2018-11-16 17:39:44'),
(6, 'Refund Policy\r\n', 'refund-and-cancellation', ' <p>Mainly our company focus customer satisfaction and their needs. In this particular event, if in case\r\n                            our customer dissatisfied with our services then we will refund back their money, after providing\r\n                            genuine reasons and after proper investigation. Please read our terms and conditions before dealing\r\n                            with our services, it provides all the details and services of our product.</p>\r\n                        <h6>Cancellation Policy</h6>\r\n                        <p>For cancellations please contact with us via our contact link.</p>\r\n                        <p>Requests received later than 4 business days and prior to the end of current service period will\r\n                            be treated as cancellation of our services for next services.</p>\r\n                        <h6>Refund Policy</h6>\r\n                        <p>In this policy we will try our best to create suitable specific design and concepts for our customers.</p>\r\n                        <p>If in case our customer are dissatisfied with our services then we will provide a refund .</p>\r\n                        <p>If paid by credit card, refunds will be issued to the original credit card provided at the time of\r\n                            purchase and in case of payment gateway name payments refund will be made to the same account.</p>', 'AC', '2018-09-10 18:34:48', '2018-11-16 18:01:54');
